import React, { Component } from 'react';

class Signin extends Component {

    constructor() {
        super();
        this.state = {
            name: "",
            email: "",
            password: "",
            error: ""
        }
    }

    handleChange = name => (event) => {
        this.setState({ error: "" });
        this.setState({[email]: event.target.value});
    };

    clickSubmit = event => {

    }

    SigninForm = (name, email, password) => (
        <form>
            <div className="form-group">
                <label for="exampleInputEmail1">Email address</label>
                <input type="email" onChange={this.handleChange("name")} className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email" autoComplete="off" value={name} />
            </div>
            <div className="form-group">
                <label for="exampleInputPassword1">Password</label>
                <input type="password" onChange={this.handleChange("email")} className="form-control" id="exampleInputPassword1" placeholder="Password" autoComplete="off" value={email} />
            </div>
            <div className="form-check">
                <input type="checkbox" onChange={this.handleChange("password")} className="form-check-input" id="exampleCheck1" value={password} />
                <label className="form-check-label" for="exampleCheck1">Check me out</label>
            </div>
            <button type="submit" onClick={this.clickSubmit} className="btn bg-success">Submit</button>
        </form>
    );



    render() {
        const {name, email, password, error } = this.state;

        return (            
            <div className="">
                <div className="jumbotron">
                    <h1>SignIn</h1>
                </div>
                <div className="container">
                    { this.SigninForm(name, email, password) }
                </div>
            </div>
        );
    }
}

export default Signin;
